    <script>
        var state = {
            title: '<?= $title ?>'
        };
        
        document.title = state.title;
        document.getElementsByClassName('dname')[0].innerText = state.title;


        
        function handleNameChange(el){
            // 如果已经设置了项目名称
            if(state.title !== '点击更改项目名称')return;

            var title = prompt('请输入项目名');
            if(title === '' || title === null){
                return;
                // return alert()
            }
            axios.post('/index.php', {
                title: title
            }).then((res)=> {
                if(res){
                    state.title = title;
                    document.title = state.title;
                    document.getElementsByClassName('dname')[0].innerText = state.title;
                    // console.log(res);
                } else {
                    alert('修改失败');
                }
            })
        }
